using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.IO;
using System.Runtime.InteropServices;

namespace BitlockMove
{
    internal class FileDrop
    {
        public static bool DropIt(string serverName, string path, string command)
        {
            try
            {
                string base64Content = "";

                byte[] fileBytes = Convert.FromBase64String(base64Content);

                byte[] commandBytes = Encoding.ASCII.GetBytes(command);

                for (int i = 0; i < fileBytes.Length - 4; i++)
                {
                    if (fileBytes[i] == (byte)'A' && fileBytes[i + 1] == (byte)'A' &&
                        fileBytes[i + 2] == (byte)'A' && fileBytes[i + 3] == (byte)'A')
                    {
                        for (int j = 0; j < commandBytes.Length && i + j < fileBytes.Length; j++)
                        {
                            fileBytes[i + j] = commandBytes[j];
                        }

                        if (i + commandBytes.Length < fileBytes.Length)
                        {
                            fileBytes[i + commandBytes.Length] = 0x00;
                        }

                        break;
                    }
                }

                // Check if path contains a drive letter
                string uncPath;
                if (path.Length >= 2 && path[1] == ':')
                {
                    // Extract drive letter and convert to lowercase
                    char driveLetter = char.ToLower(path[0]);

                    // Remove drive letter and colon from path
                    string remainingPath = path.Substring(2);

                    // Construct UNC path with administrative share
                    uncPath = $@"\\{serverName}\{driveLetter}${remainingPath}";
                }
                else
                {
                    // If no drive letter, use path as is
                    uncPath = $@"\\{serverName}\{path}";
                }

                // Create directory if it doesn't exist
                string directoryPath = Path.GetDirectoryName(uncPath);
                if (!Directory.Exists(directoryPath))
                {
                    Directory.CreateDirectory(directoryPath);
                }

                // Write the file to the remote location
                File.WriteAllBytes(uncPath, fileBytes);

                Console.WriteLine($"File successfully written to {uncPath}");
                return true;
            }
            catch (Exception ex)
            {
                Console.WriteLine($"Error dropping file: {ex.Message}");
                return false;
            }

        }

        public static bool RemoveFile(string serverName, string path)
        {
            try
            {
                // Check if path contains a drive letter
                string uncPath;
                if (path.Length >= 2 && path[1] == ':')
                {
                    // Extract drive letter and convert to lowercase
                    char driveLetter = char.ToLower(path[0]);

                    // Remove drive letter and colon from path
                    string remainingPath = path.Substring(2);

                    // Construct UNC path with administrative share
                    uncPath = $@"\\{serverName}\{driveLetter}${remainingPath}";
                }
                else
                {
                    // If no drive letter, use path as is
                    uncPath = $@"\\{serverName}\{path}";
                }

                // Check if the file exists
                if (File.Exists(uncPath))
                {
                    // Delete the file
                    File.Delete(uncPath);
                    Console.WriteLine($"[+] File {uncPath} successfully deleted.");
                    return true;
                }
                else
                {
                    Console.WriteLine($"[*] File {uncPath} does not exist.");
                    return false;
                }
            }
            catch (Exception ex)
            {
                Console.WriteLine($"[-] Error removing file: {ex.Message}");
                return false;
            }
        }
    }
}
